import { style } from "typestyle";

const HowItWorkStyle = style({
    position: 'relative',
    backgroundColor: 'white',
    padding: '200px 0',
    $nest: {
        '& .top-wave': {
            position: 'absolute',
            top: 0,
            transform: 'rotation(90deg)',
        }
    }
})

export default HowItWorkStyle
